  cwtchStruct.prototype.go = function () {
  
    this.bestMove  = 0;
    this.outOfTime = 0;
    this.nodeCount = 0;
  
    let score = 0;
    let alpha = 0;
    let beta  = 0;
    let delta = 0;
  
    for (let depth=1; depth <= this.targetDepth; depth++) {
  
      alpha = -MATE;
      beta  = MATE;
      delta = 10;
  
      if (depth >= 4) {
        alpha = Math.max(-MATE, score - delta);
        beta  = Math.min(MATE,  score + delta);
      }
  
      while (1) {
  
        score = this.search(this.nodes[0], alpha, beta, depth);
  
        if (this.outOfTime)
          break;
  
        if (score > alpha && score < beta) {
          console.log('info', 'depth', depth, 'nodes', this.nodeCount, 'score', score, 'pv', formatMove(this.bestMove));
          break;
        }
  
        delta += delta / 2 | 0;
  
        if (score <= alpha) {
          console.log('info', 'depth', depth, 'nodes', this.nodeCount, 'lowerbound', score);
          beta  = Math.min(MATE, ((alpha + beta) / 2) | 0);
          alpha = Math.max(-MATE, score - delta);
        }
        else if (score >= beta) {
          console.log('info', 'depth', depth, 'nodes', this.nodeCount, 'upperbound', score);
          alpha = Math.max(-MATE, ((alpha + beta) / 2) | 0);
          beta  = Math.min(MATE,  score + delta);
        }
      }
  
      if (this.outOfTime)
        break;
    }
  
    console.log('bestmove', formatMove(this.bestMove));
  }
  
  //}}}
  //{{{  search
  //
  // https://en.wikipedia.org/wiki/Principal_variation_search
  //
  
  cwtchStruct.prototype.search = function (node, alpha, beta, depth) {
  
    //{{{  housekeeping
    
    if (this.areWeOutOfTime() || !node.child) {
    
      this.outOfTime = 1;
    
      return 0;
    }
    
    //}}}
  
    const turn     = this.turn;
    const nextTurn = colourToggle(turn);
    const cx       = colourIndex(turn);
    const list     = this.cxList[cx];
    const inCheck  = this.isKingAttacked(list[1], nextTurn);
  
    if (depth <= 0 && !inCheck)
      return this.qsearch(node.child, alpha, beta, depth);
  
    this.nodeCount++;
  
    depth = Math.max(0, depth);
  
    const rootNode = !node.parent;
    const pvNode   = alpha != (beta - 1);
    const oAlpha   = alpha;
  
    if (!rootNode && this.isDraw())
      return 0;
  
    //{{{  check tt
    
    const i = this.ttIndex();
    
    node.ttMove = 0;
    
    if (i) {
    
      const ttFlags = this.ttFlags[i];
      const ttScore = this.ttScore[i];
    
      if (this.ttDepth[i] >= depth && (depth == 0 || !pvNode)) {
        if (ttFlags == TT_EXACT ||
           (ttFlags == TT_BETA  && ttScore >= beta) ||
           (ttFlags == TT_ALPHA && ttScore <= alpha)) {
          return ttScore;
        }
      }
    
      node.ttMove = this.ttMove[i];
    }
    
    //{{{  no tt move
    //
    // https://www.talkchess.com/forum3/viewtopic.php?f=7&t=74769
    //
    
    if (!node.ttMove && depth > 3)
      depth -= 1;
    
    //}}}
    
    //}}}
  
    let ev    = this.netFastEval();
    let score = 0;
  
    //{{{  alpha pruning
    
    //if (!rootNode && !pvNode && depth <= 2 && (ev + depth * 100) < alpha) {
      //return alpha;
    //}
    
    //}}}
    //{{{  beta pruning
    
    if (!inCheck && !rootNode && !pvNode && depth <= 2 && (ev - depth * 200) >= beta) {
      return beta;
    }
    
    //}}}
  
    node.cacheSave();
  
    //{{{  null move
    
    if (!inCheck && !rootNode && !pvNode && depth > 2 && ev > beta) {
    
      this.hashEP();
      this.ep = 0;
      this.hashEP();
    
      this.hashTurn();
      this.turn = colourToggle(this.turn);
      this.hashTurn();
    
      score = -this.search(node.child, -beta, -beta+1, depth-4);
    
      node.cacheUnsave();
      this.turn = colourToggle(this.turn);
    
      if (this.outOfTime)
        return;
    
      if (score >= beta) {
        return beta;
      }
    }
    
    //}}}
  
    let bestScore = -MATE;
    let bestMove  = 0;
  
    let move   = 0;
    let played = 0;
  
    node.initMoveGen(ALL_MOVES, inCheck);
  
    while (move = node.getNextMove()) {
  
      //{{{  make move
      
      if (!(move & MOVE_LEGAL_MASK)) {
      
        this.makeMoveBare(move);
      
        if (this.isKingAttacked(list[1], nextTurn)) {
          this.unmakeMoveBare(move);
          //node.cacheUnsave();
          continue;
        }
      
        this.unmakeMoveBare(move);
        this.makeMove(move);
      }
      
      else {
        this.makeMove(move);
      }
      
      //}}}
  
      played++;
  
      if (pvNode) {
        if (played == 1) {
          score = -this.search(node.child, -beta, -alpha, depth-1);
        }
        else {
          score = -this.search(node.child, -alpha-1, -alpha, depth-1);
          if (!this.outOfTime && score > alpha) {
            score = -this.search(node.child, -beta, -alpha, depth-1);
          }
        }
      }
      else {
        score = -this.search(node.child, -beta, -alpha, depth-1);
      }
  
      this.unmakeMove(move);
      node.cacheUnsave();
  
      if (this.outOfTime)
        return 0;
  
      if (score > bestScore) {
        bestScore = score;
        bestMove  = move;
        if (bestScore > alpha) {
          alpha = bestScore;
          if (rootNode) {
            this.bestMove = bestMove;
          }
          if (bestScore >= beta) {
            if (moveIsQuiet(move))
              node.killer = moveClean(move);
            this.ttPut(TT_BETA, depth, bestScore, bestMove);
            return bestScore;
          }
        }
      }
    }
  
    if (!played)
      return inCheck ? -MATE + node.ply : 0;
  
    if (alpha > oAlpha)
      this.ttPut(TT_EXACT, depth, bestScore, bestMove);
    else
      this.ttPut(TT_ALPHA, depth, bestScore, bestMove);
  
    return bestScore;
  }
  
  //}}}
  //{{{  qsearch
  
  cwtchStruct.prototype.qsearch = function (node, alpha, beta, depth) {
  
    //{{{  housekeeping
    
    this.nodeCount++;
    
    if (this.areWeOutOfTime() || !node.child) {
    
      this.outOfTime = 1;
    
      return this.netFastEval();
    }
    
    //}}}
  
    //{{{  check TT
    
    node.ttMove = 0;
    
    const i = this.ttIndex();
    
    if (i) {
    
      const ttFlags = this.ttFlags[i];
      const ttScore = this.ttScore[i];
      const ttMove  = this.ttMove[i];
    
      if (ttFlags == TT_EXACT ||
         (ttFlags == TT_BETA  && ttScore >= beta) ||
         (ttFlags == TT_ALPHA && ttScore <= alpha)) {
        return ttScore;
      }
    
      if (moveIsNoisy(ttMove))
        node.ttMove = ttMove;
    
    }
    
    //}}}
  
    const e = this.netFastEval();
  
    if (e >= beta)
      return e;
  
    if (alpha < e)
      alpha = e;
  
    const turn     = this.turn;
    const nextTurn = colourToggle(turn);
    const cx       = colourIndex(turn);
    const list     = this.cxList[cx];
    const inCheck  = this.isKingAttacked(list[1], nextTurn);
  
    let move   = 0;
    let score  = 0;
    let played = 0;
  
    node.cacheSave();
    node.initMoveGen(NOISY_MOVES_ONLY, inCheck);
  
    while (move = node.getNextMove()) {
  
      if (moveIsQuiet(move))
        console.log('quiet q move', formatMove(move)); //hack
  
      //{{{  make move
      
      if (!(move & MOVE_LEGAL_MASK)) {
      
        this.makeMoveBare(move);
      
        if (this.isKingAttacked(list[1], nextTurn)) {
          this.unmakeMoveBare(move);
          //node.cacheUnsave();
          continue;
        }
      
        this.unmakeMoveBare(move);
        this.makeMove(move);
      }
      
      else {
        this.makeMove(move);
      }
      
      //}}}
  
      played++;
  
      score = -this.qsearch(node.child, -beta, -alpha, depth-1);
  
      this.unmakeMove(move);
      node.cacheUnsave();
  
      if (this.outOfTime)
        return alpha;
  
      if (score > alpha) {
        alpha = score;
        if (score >= beta) {
          return score;
        }
      }
    }
  
    return alpha;
  }
  
  //}}}
  //{{{  perft
  
  cwtchStruct.prototype.perft = function (node, depth) {
  
    if (depth == 0)
      return 1;
  
    const turn     = this.turn;
    const nextTurn = colourToggle(turn);
    const cx       = colourIndex(turn);
    const list     = this.cxList[cx];
    const inCheck  = this.isKingAttacked(list[1], nextTurn);
  
    let count = 0;
    let move  = 0;
  
    node.ttMove = 0;
  
    node.cacheSave();
    node.initMoveGen(ALL_MOVES, inCheck);
  
    while (move = node.getNextMove()) {
  
      //{{{  make move
      
      if (!(move & MOVE_LEGAL_MASK)) {
      
        this.makeMoveBare(move);
      
        if (this.isKingAttacked(list[1], nextTurn)) {
          this.unmakeMoveBare(move);
          //node.cacheUnsave();
          continue;
        }
      
        this.unmakeMoveBare(move);
        this.makeMove(move);
      }
      
      else {
        this.makeMove(move);
      }
      
      //}}}
  
      count += this.perft(node.child, depth-1);
  
      this.unmakeMove(move);
      node.cacheUnsave();
    }
  
    return count;
  }
  
